            height=size[0],
            depth=size[1]
            ),
            to_connection( 
                "{}".format( botton  ), 
                "{}".format( name ) 
                )
            ]
        botton = name
        lys+=ly

    lys += [
        to_skip( of=layers[1], to=layers[-2], pos=1.25),
    ]
    return lys



